import React, { Component } from "react";
import ReactDOM from "react-dom";
import { Provider } from "react-redux";
import { I18nextProvider } from "react-i18next";
import i18next from "i18next";

import store from "./../store/react-redx-store";
import FarmerAccounts from "./client/route";

i18next.init({
  interpolation: { escapeValue: false }, // React already does escaping
  lng: "th", // language to use
  resources: {
    en: {
      translation: {
        welcome: "hello world",
        sidemenu: {
          dashboard: "డాష్బోర్డ్",
          "My Wallet": "My Wallet",
          "Help Center": "Help Center",
          "Calendar Expand": "Calendar Expand",
          "My Day": "My Day",
          "Crop Calendar": "Crop Calendar",
          "Phone Book": "Phone Book",
          Assets: "Assets",
          "No Assets Registered": "No Assets Registered",
          Learnings: "Learnings",
          Videos: "Videos",
          Blog: "Blog",
          "Farming Calculator": "Farming Calculator",
        },
      }, // 'common' is our custom namespace
    },
    th: {
      translation: {
        welcome: "హలో ప్రపంచం",
        sidemenu: {
          dashboard: "డాష్బోర్డ్",
          "My Wallet": "My Wallet",
          "Help Center": "Help Center",
          "Calendar Expand": "Calendar Expand",
          "My Day": "My Day",
          "Crop Calendar": "Crop Calendar",
          "Phone Book": "Phone Book",
          Assets: "Assets",
          "No Assets Registered": "No Assets Registered",
          Learnings: "Learnings",
          Videos: "Videos",
          Blog: "Blog",
          "Farming Calculator": "Farming Calculator",
        },
      },
    },
  },
});

export default function App() {
  return (
    <React.Fragment>
      {process &&
        process.browser &&
        ReactDOM.render(
          <Provider store={store}>
            <I18nextProvider i18n={i18next}>
              <FarmerAccounts />
            </I18nextProvider>
          </Provider>,
          document.getElementById("root")
        )}
    </React.Fragment>
  );
}
